import React from "react";

import DirectMessages from "./DirectMessages";
import HomeNavigation from "./HomeNavigation";

export default class DirectMessagesAndNavigation extends React.Component {
    render() {
        return (
            <div className="">
                <HomeNavigation />
                <DirectMessages />
            </div>
        );
    }
}
